import React from "react";

import "./components/Home.css";

function Home() {
  return (
    <div className="fluid-container container1">
      <div className="row">
        <div className="container">
          <div className="content">
            <h1>Shoping Website</h1>
          </div>
        </div>
      </div>
    </div>
  );
}

export default Home;
